  false,\n\t\"url\": null,\n\t\"notes\": \"This quarterly report summarizes the findings
  of a study on the plant ecology of Amchitka Island. Observations of topographic
  forms, microclimate relations, substrates, and their relations to the distribution
  of plant communities on the landscape were continued through the report period.
  Information on the island's flora, vegetation, succession, projected shock effects,
  recommendations, and personnel are provided.\",\n\t\"license_title\": \"License
